import React from 'react';
import { View, Text, StyleSheet, Pressable } from 'react-native';

export function Home({ navigation }) {  // Wir nehmen `navigation` aus den Props, um zu anderen Bildschirmen zu navigieren.
  return (
    <View style={styles.container}>
      <View style={styles.header}>
        <Text style={styles.heading}>Willkommen bei TSM2.0</Text>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'top',
  },
  header: {
    width: '100%',
    flexDirection: 'row',
    alignItems: 'center',
    justifyContent: 'center',
    paddingHorizontal: 15,
    paddingBottom: 10,
    marginTop: 10,
  },
  heading: {
    fontSize: 24,
  }
});
